from collections import Counter

def gameOfThrones(s):
    # Write your code here
    c=Counter(list(s))
    if len(s)%2==0:
        for i in c.values():
            if i%2!=0:
                return 'NO'
    else:
        odd=0
        for i in c.values():
            if i%2!=0:
                odd+=1
            if odd>1:
                return 'NO'
                break
    return 'YES'
st=''
print(gameOfThrones(st))
